import React from 'react'
import logo from '../../images/logo.png'
import DashboardUL from '../DashboardUL/DashboardUL'
function Dashboard() {
  return (
    <div>
        <div className="dashboard-head">
            <img src={logo} alt="" />
        </div>
    </div>
  )
}

export default Dashboard
